#PE Public Enemy is larger than life! Their existence in Hip Hop is necessary now more than ever. Their music brought consciousness and political activism to the mainstream at a time when it was really needed. As an aspiring producer in the 80s I was mesmerized by the Bomb Squad’s chaotic beats, which remain unparalleled to this day. On Friday 7.14.23 Live @ 4PM (ET) on my *HERE TO THERE RADIO* show on @applemusic I’m paying homage to #PublicEnemy 
#Funfact, the record I made a track called “Rock” from Heavy Beats vol 1, was my tribute to the Bomb Squad! I always mention them as influencers. 
Live on stage, PE is the full package.
@flavorflavofficial ‘s comedic gestures served as a balancing act for the group’s disposition. The orchestrated moves of the S1w’s made you feel like “don’t even worry about it, lol” Terminator X was the Gladiator of DJ’s. Professor Griff will fact check you. Chuck D’s voice of command makes you pay attention whether you want to or not. Saying the word Legendary is an understatement, they are truly beyond that! #PureVIBEZ
